import React from 'react'
import s from 'search.module.scss'

export default function Search() {
  return (
    <section className={s.search_block}>
      <div><p>SEARCH</p></div>
      <div>
        <input type="text" />
      </div>
      <div><button>POST AD</button></div>
    </section>
  )
}
